// src/App.js
import React from "react";
import DoadorList from "./pages/DoadorList";
import DoadorForm from "./pages/DoadorForm";

function App() {
  return (
    <div>
      <h1>Banco de Sangue (Front-end)</h1>

      <h2>Listagem de Doadores</h2>
      <DoadorList />

      <hr />

      <h2>Novo Doador</h2>
      <DoadorForm />
    </div>
  );
}

export default App;
